import React from 'react';
import { connect } from 'react-redux';
import HobbyList from './HobyList';
import { createProfile } from '../actions/profile';
import { defaultAvatar } from '../img';
import { TextField } from '@material-ui/core';

class CreateProfile extends React.Component<{createProfile: Function}>{
    render() {
        const fake = [defaultAvatar, defaultAvatar, defaultAvatar];
        const photos = fake.map((img, index) => {
            return (
                <img src={img} alt={`photo-${index}`}/>
            )
         });
        return (
            <div className="create-profile">
                <h1>Tell us more about you</h1>
                <div className="split">
                <div className="profile-photos">
                    <div className="profile-avatar">
                        <img src={defaultAvatar} alt="default-avatar"/>
                    </div>
                    <div className="photos-container">
                        {photos}
                    </div>
                    <button className="btn btn-primary">Upload</button>
                </div>
                    <div className="profile-selector">
                        <TextField className="name" placeholder="First Name" />
                    <div className="select-gender">
                        <h3>Gender</h3>
                        <button><i className="fas fa-male largeIcon"></i></button>
                        <button><i className="fas fa-female largeIcon"></i></button>
                        </div>
                    <div className="">

                    </div>
                </div>
                </div>
                <button className="btn btn-primary">Create</button>
            </div>
        );
    }
}

const mapStateToProps = (state: object) => {
    return state
}

export default connect(mapStateToProps, {createProfile})(CreateProfile);
